import React from "react";
import { Link } from "react-router-dom";
import cloud from "../images/cloud1.png";
import "./landing.css";

function Landing() {
	return (
		<div className="landingPage">
			<h1>Enter</h1>
			<img src={cloud} alt="cloud" />
		</div>
	);
}

export default Landing;
